import { createTheme } from '@mui/material/styles';

const theme = createTheme({
  palette: {
    homePage: {
      main: '#613DC1',
    },
    homePage: {
      main: '#613DC1',
    },
    homePage: {
      main: '#613DC1',
    },
    homePage: {
      main: '#613DC1',
    },
    homePage: {
      main: '#613DC1',
    },
    homePage: {
      main: '#613DC1',
    }
  }
});

export default theme;
